import React from 'react'
import Typed from 'react-typed';
import img1 from '/Users/duaashahid/Desktop/olive/src/pictures-olive/home-page-picture.png';

function Main() {
  return (
    <div className='w-full h-[600px] py-16 px-4 bg-[#F1F8FF]'>
        {/* <div className='max-w-[1000px] mt-[-200px] w-full h-screen mx-900 px-3 text-left flex flex-col justify-center'> */}
        <div className='max-w-[1240px] mx-auto grid md:grid-cols-2'>

            <div className='flex justify-left px-20 p-1'>
            <h1 className='text-black p-1 md:text-5xl sm:text-4xl text-3xl font-semibold  '>Tech Experts for </h1>
            <Typed
                className='md:text-5xl sm:text-4xl text-3xl font-semibold p-1'
                strings={['IT,', 'SAP,', 'Training.']}
                typeSpeed={120}
                backSpeed={140}
                loop
          />
          </div>

            <p className='flex md:text-2xl sm:text-xl text-xl py-5 px-20 justify-left'>
                Welcome to OLIVE Technical Services, the leading provider of comprehensive
                IT & SAP, plant services, and Trainings.
            </p>
            <button className='bg-[#1D5ADE] w-[200px] rounded-full font-medium mx-20 my-6 py-4 text-white'>View all Services</button>
            </div>

    </div>
  )
}

export default Main
